import React from "react";
// plugin that creates slider
import Slider from "nouislider";
// reactstrap components
import {
  Button,
  Label,
  FormGroup,
  Input,
  InputGroupAddon,
  InputGroupText,
  InputGroup,
  Container,
  Row,
  Col,
  CustomInput,
} from "reactstrap";

function Footer() {
 
  return (
    <>
        <Container style={{maxWidth:'100%'}}>
        <img
                    alt="..."
                    className="img1 img-responsive1"
                    src={require("assets/img/footer.png").default}
                    style={{ width: "100%" }}
                  />

        </Container>
             
      
    </>
  );
}
export default Footer;
